import React from "react";

enum ElevatorDirection {
    Up,
    Down
}

interface Elevator {
    totalFloors: number;
    floor: number;
    stops: number[];
    direction: ElevatorDirection;
}

interface User {
    waiting: boolean;
    startFloor: number;
    endFloor: number;
}

interface ElevatorSystemState {
    elevators: Elevator[];
    users: User[];
}

class ElevatorSystem extends React.Component<{}, ElevatorSystemState> {

    constructor(props) {
        super(props);

        this.state = {
            elevators: [],
            users: []
        }
    }

    render() {
        const {elevators, users} = this.state;

        return (<div className='elevator-system'>
            <div className="elevator-system--elevators">
                {elevators.map(el => 
                    <div className="elevator-system--elevator"></div>
                )}
            </div>
            <div className="elevator-system--users">
                {users.map(el => 
                    <div className="elevator-system--user"></div>
                )}
            </div>
        </div>)
    }
}

export default ElevatorSystem;
